const styles = (theme) => ({
  lossInfoTitle: {
    borderBottom: 0,
    marginBottom: 0,
    paddingBottom: 0,
    paddingLeft: 32
  },
  lossTime:{
    marginTop: 20
  },
  datepicker: {
    '& > div': {
      color: theme.palette.neutral.dark,
    },
  },
  catCodeSelect: {
    '& .MuiBox-root': {
      overflow: 'hidden',
    },
  },
  warningMessage: {
    textAlign: "left",
    fontSize: 11,
    fontWeight: 400
  },
  uploadDocumentContainer: {
    margin: '1.75rem'
  }
});

export default styles;
